import { getConnection } from "./../database/db.js";

async function consultarDatosBecas() {
 
  const connection = await getConnection();
    const result = await connection.query(
    `SELECT COUNT(id) AS total, (SELECT COUNT(horario)  FROM becas where horario = "Satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS horario_satisfechos, (SELECT COUNT(horario)  FROM becas where horario = "No satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS horario_no_satisfechos,(SELECT COUNT(disponibilidad_personal)  FROM becas where disponibilidad_personal = "Satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS disponibilidad_satisfechos,(SELECT COUNT(disponibilidad_personal)  FROM becas where disponibilidad_personal = "No satisfecho" and  id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS disponibilidad_no_satisfechos, (SELECT COUNT(atencion_personal)  FROM becas where atencion_personal = "Satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS atencion_satisfechos, (SELECT COUNT(atencion_personal)  FROM becas where atencion_personal = "No satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS atencion_no_satisfechos,(SELECT COUNT(amabilidad_personal)  FROM becas where amabilidad_personal = "Satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS amabilidad_satisfechos,(SELECT COUNT(amabilidad_personal)  FROM becas where amabilidad_personal = "No satisfecho" and id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2")) AS amabilidad_no_satisfechos FROM becas where id_alumno in (SELECT id_alumno FROM alumnos where carrera =  "2");`
  );
  return await result;
}
